import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

function Expenses(props) {
  return (
    <div className="expenses">
      <ExpenseItem
        name={props[0].name}
        price={props[0].price}
        date={props[0].date}
      />
      <ExpenseItem
        name={props[1].name}
        price={props[1].price}
        date={props[1].date}
      />
      <ExpenseItem
        name={props[2].name}
        price={props[2].price}
        date={props[2].date}
      />
    </div>
  );
}

export default Expenses;
